(2, '/', 'seccion_1_subtitulo', '<p>"Transportation Specialist"</p>', '2018-04-23 23:28:34', '2018-04-26 03:55:13'),
(3, '/', 'seccion_1_contenido', '<p>M.C. Int''l Transportation Inc has been providing creative solutions for our customers since 1993. Our customers'' satisfaction has always been measured by our exceptional growth and the commitment of our employees to be the most innovative industry leader in the marketplace.</p><p>We are an Intermodal Carrier having 48 state authority, servicing the international markets and specializing in the transportation and storage of ocean marine containers.</p><p>We are committed to our task of being the best Intermodal trucking company in the Southeast. We take great pride in our work and understand what it takes to be the best.</p><p>We have worked hard to attract experienced professionals, obtain the latest technology, acquire the physical facility as well as put into place all of the necessary control procedures to insure professional service from start to finish.</p>', '2018-04-23 23:29:07', '2018-04-26 03:55:34'),
(4, '/', 'seccion_2_txt_1', '<p>We combine the best of our skills and ideas to present you products really worth your attention that will change the way you think about design.</p>', '2018-04-26 03:37:31', '2018-04-26 03:37:31'),
